What if I''m not happy with my order?</strong></div>\r\n<div class="content">We want your shopping experience with us to be easy    and enjoyable. We GUARANTEE our products are in Perfect condition  when   they leave our premises. We use only the best postage services  and we   are always here to answer your questions or concerns. If for  any   reason you are unhappy with your order once received, you may  return   items for a complete refund for the cost of goods excluding  postage   &amp; handling.<strong><br /><br /><br />Damaged goods</strong></div>\r\n<div class="content">Please advise immediately upon receipt via email:    info@hallstaekwondo.com.au or fax 03 9330 0053 to arrange return and    either replacement or refund.<strong><br /><br /><br />100% Guarantee</strong><br />In the event that  you are   not totally satisfied with any items received, please notify  us by  email  at info@hallstaekwondo.com.au or fax 03 9330 0053 within 3  days  from  receipt of goods, to arrange return and a credit refund on  your   purchase.<br /><br /><br /><strong>Returned Goods</strong><br />All returned goods  must be in   their original condition and packaging where applicable,  for a refund   to be effected. NOTE: Where an item is sealed, it MUST  remain sealed to   receive a refund.<strong><br /><br /><br />WE WILL NOT ACCEPT RETURNED GOODS SENT C.O.D.</strong><br />The cost of the return freight and insurance is the purchaser''s responsibility.<strong><br /><br /><br />AUSTRALIAN RETURNS</strong><br />Return via Australia Post Registered Mail - Insured<strong><br /><br /><br />REFUNDS</strong><br />Once  we have received the goods we will issue a refund for the total  purchase price in AU$, excluding postage &amp; handling. Where   goods  are purchased using a credit card, we will issue the refund to   your  credit card. Please provide your credit card details with your   return  as these are never sited or stored. All other refunds will be  made via cheque. All returned goods must be sent prepaid and insured by  the purchaser, we will not refund these costs. We   will not  issue refunds for any seal that has been cut, modified or   reworked in  any way. The cost of the return freight and insurance is   excluded and  is the purchaser''s responsibility. We will issue your refund only after  the goods have been returned and received by us.<strong><br /><br /><br />Please note:</strong><br />You are solely responsible for the theft, loss or damage of the goods once they are in your possession.<strong><br /><br /><br />ALL ITEMS RETURNED - MUST BE ADDRESSED TO:</strong><br /><br />Hall''s Taekwondo<br />261 Mickleham Road <br />Tullamarine, Victoria, 3034</div>\r\n<div class="content">Australia<br /><br />Parcels  are sent in good faith upon order from you. Credit Card Security, Is it  safe to enter my credit card details onto your site? We have gone to  great lengths to ensure our payment process is totally secure. We    have a world class payment process in place, with the highest level  of   security available (128bit encryption), all payments are made via Paypal Australia.At no stage do we    have access to your credit card details. We are serious about    protecting you. We want you to enjoy the process of shopping at Hall''s    Taekwondo knowing that your details are safe.<strong><br /><br /><br />Taxes &amp; Duty</strong><br />Hall''s Taekwondo is not    responsible for customs duties or taxes imposed by countries other  than   Australia, where the GST rate is 10%. Where the country of   import  declares customs duties or clearance charges, they are the    responsibility of the purchaser. Privacy Policy Your privacy, both    personal and business, is important to us. That''s why we''ve invested in    some of the latest security systems and we are committed to  maintaining   industry standards. It is important that you fully  understand the way we obtain and use your   personal information and  also the limited circumstance in which we   might disclose it. This  privacy statement details the information we   gather, how we may use  it, and how you can correct or change it if   necessary. <br /><br /><strong>Our web  site has areas where you can provide personal   information to identify  yourself. We have developed this Privacy  Policy  to inform you of our  policies and practices regarding such  information.</strong><br /><br />This   document is the Privacy Policy of Hall''s  Taekwondo. It relates to the   web pages and services available at the  Hall''s Taekwondo website   www.hallstaekwondo.com.au<br /><br />Hall''s  Taekwondo, the home of Hall''s   Taekwondo online may make alterations to  this document from time to  time  and will update the policy at the Site.  <br /><br />Hall''s Taekwondo,  the  home of Hall''s Taekwondo online will  take all reasonable steps to  act in  accordance with the policy when  using the Site. <br /><br />Hall''s   Taekwondo, the home of Hall''s Taekwondo  online assumes no  responsibility  for the information practices of other  web sites that a  user is able to  access through our Site.<br /><br /><br /><strong>What information do we collect?</strong><br />The    information we collect from you depends on what you''re doing. When  you   apply to Hall''s Taekwondo, the home of Hall''s Taekwondo online, we   will  collect personal details such as your name, email address,  postal   address and phone number. This information is essential for us  to be   able to accurately identify you when you access these services.  We may   collect other demographic information about you in order to  help us   better serve your needs and requirements. Other  information may   also be recorded. Whenever a page is requested from  our web server, we   record the time, date and Internet Protocol (IP)  address of the  request,  along with information on the browser software  being used. We  use this  information to improve our technical  structure and performance  and it is  not in any way used to  specifically identify you.<br /><br /><br /><strong>How do we use your information?</strong><br />We    may use your contact details to send you information about Hall''s    Taekwondo, including material such as information on new products and    services we may offer. <br /><br />Your credit card number will only be used    to charge you, for the products and services for which you have    subscribed and as already stated we do not receive this information it    is only used by the bank to process your transaction as authorised by    you. <br /><br />We will treat the information we collect from you as    strictly confidential. Other than as set out below, we will not reveal,    disclose, sell, distribute, rent, licence, share or pass on to any   third  parties, any personal information that you may have provided to   us,  unless we have your express consent to do so. <br /><br />Exceptions to this are:</div>\r\n<div class="content">Where    there are reasonable grounds to believe that disclosure is necessary   to  prevent a threat to life or health; and;  Where Hall''s Taekwondo   home  of Hall''s Taekwondo Online is required by law to provide your    information.   Security The open nature of the Internet means no data    transmission can be guaranteed 100% secure. While we strive to protect    your information, we cannot guarantee the security of any information    you transmit to us or receive from our online products or services.    Therefore these activities are conducted at your own risk. Once we    receive your information, we will use our best efforts to ensure its    security.<strong><br /><br /><br />Contact us</strong><br />If you have any  questions   about this policy statement, the practices of our site, or  your dealings   with Hall''s Taekwondo home of Hall''s Taekwondo Online,  please contact   us.<br /><br /><br /><strong>Any other questions? Please contact us - we''d love to hear from you!</strong></div>\r\n<div class="content">Halls Taekwondo Systems Pty Ltd</div>\r\n</div>', NULL, 0),
(12, 190, '<p><strong>Single sessions, multiple block sessions or ongoing programs for small or large school groups. </strong><br /><br />Come to one of our modern fitness centres, exclusive to you during the day or our expert instructors can come to you.<br /><br />Tailored to suit your needs, see below examples of what we can do for you:</p>\r\n<h2>Basic Taekwondo</h2>\r\n<p><br />Learn the foundations of the world&rsquo;s most popular martial art; basic kicking, blocking and self defence. Gain confidence and try something new whilst learning martial art values, discipline and self respect.<br /><strong><br />Self Defence</strong><br /><br />Male/Female/Mixed focus as required. Learn how to turn fear into freedom. Students will learn to be street safe and how to defend<br />themselves should a dangerous situation arise. Importantly, they will learn to avoid dangerous situations with a sensible mindset respecting themselves and others.<br /><strong><br />Fitness Challenge</strong><br /><br />Motivate students to take their health and fitness seriously by getting students moving and enjoying physical activity. Help them discover fitness with meaning and challenge them to be fit for life.<br /><strong><br />Bully Proof</strong><br /><br />Educate students in how to avoid, resolve and manage conflicts with bullies. Prevent students from becoming bullies by teaching awareness and self control.<br />Teaching respect for each other through a martial arts mindset.<br /><strong><br />Motivational Coaching</strong><br /><br />Successful coaching that students can take beyond sport, to all areas of their lives. They will learn about winning habits, stepping out of their comfort zone and developing a mentality that will encourage consistent aspirations to achieve their personal best.</p>\r\n<p>&nbsp;</p>\r\n<h2><strong>WHY CHOOSE HALL''S TAEKWONDO?</strong></h2>\r\n<p><strong><br />Convenience</strong></p>\r\n<p><br />Easy to work with. You come to one of our full time centres or we bring our equipment to your school. We can take care of everything.<br /><strong><br />Skills For Life</strong><br /><br />Emphasis on character building; developing the whole person from the inside and out.<br /><strong><br />Winning Habits</strong><br /><br />Simple and easy habits that build confidence, self-esteem and healthy body image.<br /><br /><strong>Experience</strong><br /><br />Full time instructors since 1984; professional, well organised and committed long term. We have been teaching in schools for over 25 years.<br /><strong><br />Relationships Long Term</strong><br /><br />We understand the development of children of different ages and we have cultivated programs to target specific age groups and abilities.<br /><strong><br />Positive Results</strong><br /><br />Reflected in testimonials from teachers who say our influence improves students&rsquo; approach to school work and peers. Instructors are great role models inspiring success.<br /><strong><br />Tailored To Suit Your Needs</strong><br /><br />Programs are flexible and can be adapted to meet your desired outcomes and availability.<br /><strong><br />Value For Money</strong><br /><br />We combine education with entertainment for lasting impact with students.<br /><br /></p>', NULL, 1574),
(55, 348, '<p><strong>Our web  site has areas where you can provide  personal   information to identify  yourself. We have developed this  Privacy  Policy  to inform you of our  policies and practices regarding  such  information.</strong><br /><br />This   document is the Privacy Policy of  Hall''s  Taekwondo, Australia. It relates to the   web pages and services available  at the  Hall''s Taekwondo website   www.hallstaekwondo.com.au<br /><br />Hall''s   Taekwondo, the home of Hall''s   Taekwondo online may make alterations  to  this document from time to  time  and will update the policy at the  Site.  <br /><br />Hall''s Taekwondo,  the  home of Hall''s Taekwondo online  will  take all reasonable steps to  act in  accordance with the policy  when  using the Site. <br /><br />Hall''s   Taekwondo, the home of Hall''s  Taekwondo  online assumes no  responsibility  for the information  practices of other  web sites that a  user is able to  access through  our Site.<br /><br /><br /><strong>What information do we collect?</strong><br />The     information we collect from you depends on what you''re doing. When  you    apply to Hall''s Taekwondo, the home of Hall''s Taekwondo online, we    will  collect personal details such as your name, email address,  postal    address and phone number. This information is essential for us  to be    able to accurately identify you when you access these services.  We  may   collect other demographic information about you in order to  help  us   better serve your needs and requirements. Other  information may    also be recorded. Whenever a page is requested from  our web server, we    record the time, date and Internet Protocol (IP)  address of the   request,  along with information on the browser software  being used. We   use this  information to improve our technical  structure and  performance  and it is  not in any way used to  specifically identify  you.<br /><br /><br /><strong>How do we use your information?</strong><br />We    may use  your contact details to send you information about Hall''s    Taekwondo,  including material such as information on new products and    services  we may offer. <br /><br />Your credit card number will only be used    to  charge you, for the products and services for which you have     subscribed and as already stated we do not receive this information it     is only used by the bank to process your transaction as authorised by     you. <br /><br />We will treat the information we collect from you as     strictly confidential. Other than as set out below, we will not reveal,     disclose, sell, distribute, rent, licence, share or pass on to any    third  parties, any personal information that you may have provided to    us,  unless we have your express consent to do so. <br /><br />Exceptions to this are:</p>\r\n<div class="content">Where    there are reasonable grounds to believe  that disclosure is necessary   to  prevent a threat to life or health;  and;  Where Hall''s Taekwondo   home  of Hall''s Taekwondo Online is  required by law to provide your    information.   Security The open  nature of the Internet means no data    transmission can be guaranteed  100% secure. While we strive to protect    your information, we cannot  guarantee the security of any information    you transmit to us or  receive from our online products or services.    Therefore these  activities are conducted at your own risk. Once we    receive your  information, we will use our best efforts to ensure its    security.<strong><br /><br /><br />Contact us</strong><br />If  you have any  questions   about this policy statement, the practices of  our site, or  your dealings   with Hall''s Taekwondo home of Hall''s  Taekwondo Online,  please contact   us.<br /><br /><br /><strong>Any other questions? Please contact us - we''d love to hear from you!</strong></div>\r\n<div class="content">Halls Taekwondo Systems Pty Ltd</div>', NULL, 0),
(21, 261, '<p>"<em>Both speakers were great - I had the wrong mindset when we first discussed the board breaking idea and that all delegates had to break one. But you know Martin, had all our delegates buying into the presentation and I am proud to say that "YES" I did break my board. It was very cool, so if you get an opportunity to attend his session, its well worth it, we had "awesome" feedback from our group here in NZ</em>."</p>\r\n<p><strong>Joanna Fifita, Foodstuffs, New Zealand </strong></p>\r\n<p><br /><em><br />"My Wife and I arranged a birthday party for our 2 boys, aged 3 and 5 and 38 children in all attended, and double that number again in adults and friends. We were totally amazed with the way all of the children were made to feel so valued and an important part of the day, also memorable was the look on the faces of the parents and friends gathered, amazed and glazed, so proud of these their mainly kindergarten aged and younger, bright and enthusiastic, totally alive and glowing so young and yet so involved in every aspect of the proceedings. Today Monday I have been inundated in thanks for such a great party that involved not only the children but the adults also, sad to reflect we can not take the credit all we did was book the party and you did the rest. Thank you for a wonderful day,"</em></p>\r\n<p><strong>Lucy Van Bergen, Victoria, Australia </strong><br /><em><br />"I look forward to my classes every single week. I work long, stressful hours and I enjoy the emotional and physical benefits a good, hard class of full on training gives me. I draw strength and inspiration from my instructors and my classmates, young and old. This enables me to face the dog-eat-dog corporate world in which I work, head on. TKD at Halls is more than just training sessions and a path to Blackbelt - it is an holistic approach to a better life."</em></p>\r\n<p><strong>George Buscema </strong><br /><br /><em><br />"Hi there. Before I started taekwondo, I was so shy and had no confidence at all. Taekwondo has helped me to come out of my shell and have heaps of confidence. I am also now very loud and much stronger. I have also benefited from taekwondo by gaining more friends and leadership skills. My goal is to get to black belt. I''m not going to give in and quit. Thank you Hall''s!"</em></p>\r\n<p><strong>Leila</strong>, <strong>Victoria </strong><br /><br /></p>\r\n<p><em>"Martin, We have been at Tullamarine since it first opened ... many thanks Martin for not having a good club but a GREAT FANTASTIC CLUB and family enviroment. I have seen my kids develop into very strong and positive, confident children this is because of the training and desire to be successful and always wanting to improve and go the next step. This is because the instructors at Hall''s are always so positive and committed at what they preach and also haveing good ethics towards anything that can help. My kids are in the bunch that will be going for their black belt at Tullamarine, thanks agiain for making my kids blossom in the right environment and showing them that they can achieve something in life with hard work. Having seen my kids develop this way my wife and I have also joined Hall''s Taekwondoand we are loving it also. Again many thanks to the entire staff at Hall''s for their passion and desire to make the kids and adults achieve there goals"</em></p>\r\n<p><strong>Hemala Family, Melbourne<br /></strong><br /><br /><em>"Since my son Cameron started at Hall''s Tullamarine approx 6 months ago, he has been fantastic. Thanks especially to Luke, Nathan and all the family at Hall''s Tullamarine. I am 46 and decided that if my son can do it then I should join him and ''have a go'', I have joined and wish that I had done it years ago. It is the best thing that I have done for myself. I love every session (even though it is hard work) I cannot say enough for the dedicated and patient staff (especially for us older students) I really feel like part of what I know as the ''Halls family'', it is sensational."</em></p>\r\n<p><strong>Tony Campion, Melbourne</strong><br /><em><br />"I have never enjoyed training as much as I do time there. This shows you how advanced Halls Taekwondo is to other clubs around Australia. I recommend Halls to any person who wishes to give Taekwondo a go. You will not be disappointed. Thankyou."</em></p>\r\n<p><strong>Paul Symons, Melbourne, Australia</strong><br /><em><br />"I have just watched your guys on TV and thought they were amazing. Congratulations to Halls and all the guys in the team. I have cast my vote for them and have asked all our Taekwondo members to do the same. All the best... hopefully they will get into the Grand Final."</em></p>\r\n<p><strong>Ang, TA </strong><br /><br /><em>"Boot Camp ROCKS!! I just finished my third Boot Camp today and I can honestly say I have not felt this good for a very long time. Yeah, it''s hard work getting up before the sun does but let me assure you, the benefits are awesome! Do yourself a favour - enlist for the next Boot Camp ASAP - you will NOT regret it! Daniel you were inspirational and helped me achieve more than I thought I could. Luke, Nathan, Kieren and Tash as always you worked us hard. To my running mates Vinnie and Tristan - you guys made it so much fun. I look forward to our "normal" regular runs... starting tomorrow... Woo-hoo! George Buscema PS - I STILL hate the ''eagle''!"</em></p>\r\n<p><strong>George, Melbourne</strong><br /><br /><em>"Dear Martin and Jeanette, </em></p>\r\n<p><em>Thank you to Hall''s Taekwondo for the fantastic job you did on Saturday at the gradings. I loved the way you included the brothers and sisters of the Little Ninja''s and Commando''s when giving out the Easter eggs. They were excited to be apart of the action. I thought of it as a little something for them as they are always supporting their big sister Regina in her efforts to do and be the best she can. My mother-in-law also loved the demonstration from demo team xtreme. She could not stop raving about them, especially the young boy who was the star of the show. It was fantastic to see someone so young do such a wonderful job. He was a great inspiration to all the young children and adults alike! It was especially great to hear Regina saying that when she gets bigger that''s what she''ll be doing. Having seen the demonstration really opened her eyes at just what you can achieve with hard work and dedication, not that she doesn''t already do that. Once again a big thank you to you both and to all of your dedicated staff who do a fantastic job as well. You have a great team and should be proud of them."</em></p>\r\n<p><strong>Rose Evangelou, Victoria</strong><br /><br /><em>"Hi to all that have made a difference to me and my family''s life... Thanks to all the team at Halls Tullamarine for all your encouragement, time, pateience, expertise and motivation. Since my son adam, husband carmine and myself have joined your club we have united together as a family more than ever before its amazing how fit and focused we are in life in general, whether it be work, home, at the park, we have more energy, determination, focus etc. I can not thank you enough for all your time. I can not speak highly enough of your club and crew you have you are all amazing. Thanks once again for making a difference."</em></p>\r\n<p><strong>Sonia Cambareri</strong>,<strong> Melbourne</strong><br /><br />&nbsp;<br /><em>A big THANK YOU to Halls Team, for having such a fantastic facility at Tullamarine. My son Cameron, does little ninjas on Tues, Thurs, and Sats, and since begining, his confidence levels have sky-rocketed. Cameron just loves going to taekwondo. In addition, the trainers, Luke, Nathan, Nick, Tiffiny and Mel, should be commended on a fantastic job they do with the kids. I have nothing but fabulous things to say about them and the programme. Well done!!</em><em>"</em></p>\r\n<p><strong>Connie D''Souza, Tullamarine </strong><br /><br /></p>', NULL, 0),
(91, 996, '<p><strong>Q. What do I need to do to get started with my website project?</strong><br />Choose the website you are after, whether it be the Unlimuted LITE Website or the Unlimited ELITE website and proceed to finalise your order online by adding to cart from our Online Shop. Upon checkout to the payment gateway you will be required to pay your 50% desposit in order for your project to be commenced. You will receive a receipt for your purchase and a RealTools representative will be in touch to get your project underway.</p>\r\n<p><strong>Q. How long will it take for my website to be built?</strong><br />From the date we receive your deposit payment, we will require up to an including 3 weeks to deliver, however in some case we have delivered the same week. The turnaraound time varies depending on the deand that week however we advise you plan for 3 weeks of turnaround time for your project to be ready for you to approve and send live to the world wide web.</p>\r\n<p><strong>Q. Do I add the content I want to my new website myself?</strong><br />Yes. Once we are ready to handover your website for your approval and testing we will also train you on how to use your website and manage, edit and upload new content and pages as you wish. Remember our websites come with Unlimited pages so we will train yo on how to capitalise on this feature.</p>\r\n<p><strong>Q. When is my final payment due to be paid to RealTools?</strong><br />Your final payment (remainder balance) is due to be paid once we have delivered everything on the invoice to perfect operation. We will then train you and hand over the keys to your website at this time. We will require final payment upon handover of the site to you to carry out the final touches to your content before sending the site live. Once you are pleased with the website on the staging area, send us an email at production@realtools.com.au and we will send your website live as soon as we have the correct domain name information from you.</p>\r\n<p><strong>Q. How do I add property listings to my new website?</strong><br />You can add them manually using our Property Uploader feature in our WebPublisherCMS which comes standard with the Unlimited LITE and ELITE Websites or you can have them automatically added to your website every 2 hours direct from MyDesktop to our servers parsed via XML feed from your MyDesktop account. This is a powerful feature and we have literally hundreds of websites on our servers each day parsing property data to the websites of new listings and the like. This service is an additional charge to setu pand to maintain and needs to be selected in the online store shold you require XML Property Data Integration. *We only support MyDesktop XML (REA format) Data Feed at this time.</p>\r\n<p><strong>Q. What if something goes wrong with my website?</strong><br />The ever changing Internet means we cannot guarantee our products for good, however offer a 90 day operational warranty on all of our products from the date of completion (completion is defined as all items no the invoice are perfect and operational; it is not the date the site went live). After the 90 day period you will be required to be under a hosting and support cover which will be billed by 3 monthly, 6 monthly, or 12 monthly. A separate invoice will be provided to you for this service from a RealTools representative.</p>\r\n<p><strong>Q. Do I have to host my new website with RealTools?</strong><br />Yes. In order for our technology to work it must reside on our hosting environment. In addition, our XML property data feed parser has been exclusviely configured to handle data integration from MyDesktop to our servers and connected to your new website, moving servers will break this process.</p>\r\n<p><strong>Q. Do I own my website?</strong><br />You do own your website design and pages, however you do NOT own the software system (back-end) and WebPublisherCMS your website depends on to operate. We have developed a proprietry method to power real estate websites with seamless property data integration with the leading real estate CRM to ensure your website is treated just like the major advertising portals with property data pushed regularly with new listings and updates to existing listings. If you wish to move your website to another hosting service you will be able to take your website design and pages but you will forfeit your license to use our WebPublisherCMS system and your XML Property Data Integration. We are the leaders in property data integration in Australia and highly recommend you keep your service with us as we are always evolving our software to be better and ultimately bring ongoing value to you our valued clients.</p>\r\n<p><strong>Q. Are there any ongoing charges?</strong><br />Ongoing charges are applicable to some of our products, namely the hosted solutions and a separate invoice will be issued for this service. Hosting with our servers for RealTools products is compulsory as our technology is dependent on our server setup and configuration. Furthermore, this is how we protect our intellectual property which is available to you under license.</p>\r\n<p><strong>Q. Can I take the source .FLA when I buy a banner from RealTools?</strong><br />No. RealTools owns the source .FLA files which remains our property, however we will release the .SWF file which is produced for you to then use on the major portals you are advertising on. If you wish to have a custom set of banners designed and own the source .FLA we will produce these for you from our sister business division, Visiontech Digital and quote for them according to your needs.</p>', NULL, 0),
