(87, 973, '<h2>&raquo; spectacular</h2>\r\n<h2>&raquo; youthful experienced team</h2>\r\n<h2>&raquo; dynamic&nbsp;&raquo; entertaining&nbsp;&raquo; inspiring</h2>\r\n<p>&nbsp;</p>\r\n<h2>Hall''s Taekwondo believes the difference between living an ordinary life and an outstanding life is rarely based on ability.</h2>\r\n<p><br />Instead, it''s the state of your mind and body in any given moment<br /><br />that shapes the way you think, feel, behave and perform.<br /><br /></p>\r\n<h2>Accessing your most powerful mental and emotional states, you can literally work wonders!</h2>\r\n<p><br />Let Hall''s Taekwondo Demo Team Xtreme excite your customers, enthuse<br /><br />your staff and increase the heartbeat of your environment!<br /><br />Demo Team Xtreme helps you access your most powerful mental and emotional states!<br /><br />Award Winning Hall''s Taekwondo Demo Team Xtreme&nbsp; is disciplined, imaginative and full of energy -<br /><br />Feel ''success'' through Demo Team Xtreme!<br /><br />* Performances have included Make-a-Wish at Crown Palladium Casino, Special Performance for HRH Prince Charles, Grand Finalists on Australia''s Got Talent.</p>', NULL, 1563),
(177, 3750, '<p>Our hosting platform hosts servers in Data Centers that are designed to provide an environment necessary to keep your servers running 24 hours a day, 7 days a week.</p>\r\n<p>Our hosting platform''s Data Center has the following protection systems in place to ensure maximum operation regardless of the disruption:</p>\r\n<p><span style="text-decoration: underline;">RAID</span><br />All our dedicated servers are configured on RAID 1.</p>\r\n<p><span style="text-decoration: underline;">Power</span><br />Our hosting platform power system is made up of:</p>\r\n<p>&bull;Commercial Utility Underground Conduits <br />&bull;Redundant UPS System <br />&bull;30-45 mins of backup time (Industry Standard: 15 mins) <br />&bull;Multiple incoming power supplies <br />&bull;Dual-feed secondary switchboard and critical load distribution boards <br />&bull;Backup Diesel Generator <br />*Note: Data Center specfications may differ from country to country.</p>\r\n<p>&nbsp;</p>\r\n<p><span style="text-decoration: underline;">Security</span><br />Security is paramount to all our customers. Hence, the Data Center and network has been designed with that in mind. Our hosting platform provide a comprehensive security system which includes:</p>\r\n<p>&bull;visitation controls <br />&bull;visitation logging <br />&bull;dedicated ethernet system, <br />&bull;network monitoring <br />&bull;site security guard.</p>\r\n<p>All visitors to the Data Center are identified against a client-defined access control list. Each visitor is also issued a badge and his entry and exit to the center is logged. Visitors in the Data Center are monitored from an open glass view panel.</p>\r\n<p>Each dedicated server housed in Our hosting platform''s Data Center is connected via a dedicated ethernet switch rather than Hubs. This arrangement protects the confidentiality of traffic within our network and ensures no other server housed on our network can tap the data flowing through our network.</p>\r\n<p><span style="text-decoration: underline;">Environment</span></p>\r\n<p>&bull;Raised Flooring <br />&bull;HVAC temperature control systems <br />&bull;Separate Cooling zones <br />&bull;Individual Rack Level Circuit Breaker</p>\r\n<p>Our hosting platform''s Data Center is equiped with multiple units of conditioning units, a complete FM-200 fire supression system, a complete smoke detection system and a piped sprinkler system. Each rack is also earth-grounded and has its own individual circuit breaker for that extra redundancy.</p>', NULL, 0),
(165, 3367, '<p style="text-align: left;"><strong><span style="font-size: small;">Hall''s Taekwondo Club Championships</span></strong><br /><strong><span style="font-size: small;">Sunday 7th August, 2011</span></strong><br /><strong>8:45 - 3:30pm</strong></p>\r\n<p><span style="font-size: small;">Venue: State Netball Hockey Centre</span><br />1 Brens Drive, Parkville, Melbourne.</p>\r\n<p>This Event is for Everyone, don''t miss out!</p>\r\n<p>To assist with late Entries we have uploaded a<strong><em><span style="color: #ff0000;"> ''Last Minute Entry Form'' </span></em></strong>to send through to us no later than 2pm Saturday 6th August.</p>\r\n<p>Inviting Joeys, Little Ninjas, Commandos, Leaders, Teens &amp; Adults of all belt levels.<br />Testing students'' skills and experiencing the joy and exhilaration of competition in a controlled environment.&nbsp; This is an all day event with specific category times opposite.</p>\r\n<p><span style="color: #ff0000;"><strong>COMPETITION ENTRY</strong></span><br />Students enter one or more of the following categories:<br />&raquo; Sparring<br />&raquo; Patterns <br />&raquo; Team Sparring<br />&raquo; Creative Patterns<br />&raquo; Black Belt Demonstration Competition</p>\r\n<p>&nbsp;</p>\r\n<p><span style="color: #ff0000;"><strong>PROGRAM OUTLINE</strong></span><br /><strong><span style="color: #0000ff;">8:45 - 10:30am</span></strong><br /><span style="color: #ff0000;"><strong>Joeys &amp; Little Ninjas Events</strong></span><br /><em>Last 15 min''s we stay on the courts and enjoy demonstrations by Black Belt Demo Teams!</em><br /><br /><strong><span style="color: #0000ff;">10:15am for 10:30start - 1:30pm</span></strong><br /><span style="color: #ff0000;"><strong>Commandos</strong></span><br />Coloured &amp; White Belt Events<br /><br /><strong><span style="color: #0000ff;">12:00 - 1:00pm</span></strong><br />Demonstration Competitions<br /><span style="color: #ff0000;"><strong>Commandos/Leaders/Teens</strong></span><br />Black Belts<br /><br /><strong><span style="color: #0000ff;">1:00-3:30pm</span></strong><br /><span style="color: #ff0000;"><strong>Leaders/Teens/Adults</strong></span><br />Coloured Belt &amp; White Belt Events <strong><span style="font-size: small;">&amp;</span></strong><br /><span style="color: #ff0000;"><strong>Commandos/Leaders/Teens/Adults</strong></span><br />Black Belt Events<br /><span style="color: #ff0000;"><a title="Contact us" href="../location/head-office/1484"><span style="color: #800080;">Contact us with last minute entries</span></a><strong><br /></strong></span></p>', NULL, 0),
(77, 750, '<p>RealTools is a specialist business division, designed specificallty to meet the high demands for world class, next generation digital marketing tools from the Real Estate sector; RealTools is owned and operated by the award winning Visiontech Solutions which has been established since 1997.</p>\r\n<p>Leveraging off the reputation and market credibility of the Visiontech group of companies and business divisions, RealTools is a category leader in digital media and web technology innovation within the Australian Real Estate Sector with over 15 years of industry experience.</p>\r\n<p>As category leaders, we pride ourselves on the endless journey that is innovation and our product suite is testimony to this fact. Our industry alliances and national client base which extends into the thousands are loyal to our brand of products and services and value the guidance offered in assisting them to market and operate their real estate businesses with ''Real'' Tools to list, sell and manage more property.</p>\r\n<p>Visiontech Solutions opened for business in July 1997 and developed its foundations on Real Estate branding and marketing which over the years to follow became a full service digital media house with a strategic focus on the Real Estate agent and the agency he or she operates out of. Fast forward to 2011 and Real Estate Digital Marketing is just one of the many strengths of Visiontech Solutions. We now operate out of Sydney and Melbourne and service the world with the following core business units and services:</p>\r\n<p><strong>RealTools</strong><br />Real Estate Digital Marketing Products<br /><a href="../../" target="_blank">realtools.com.au</a></p>\r\n<p><strong>Visiontech Digital</strong><br />Custom Web Design + Development<br /><a href="http://www.visiontechdigital.com" target="_blank">visiontechdigital.com</a></p>\r\n<p><strong>Synagize eSystems</strong><br />SaaS and Custom Application Development<br /><a href="http://www.synagize.com" target="_blank">synagize.com</a></p>\r\n<p>Our industry Alliances with MyDesktop, Domain and the major real estate groups, has positioned RealTools as a dominent force in the sale of value Real Estate website packages in the Australian Real Estate industry landscape.</p>\r\n<p>With our server technology in place to handle and parse XML property feeds from literally hundreds of Real Estate websites around the country, 365 days a week, we have created a niche market position with our state of the art web technology and property data integration methods and are paving the way to meet the demands of Real Estate professionals and their online marketing needs across the globe.</p>', NULL, 1578),
(130, 1510, '<p>As well as <a title="eNewsletter" href="../enquiry/newsletter/"><span style="color: #ff0000;">on-line news</span></a><span style="color: #ff0000;">,</span> Members are given glossy hard copy Newsletters four times a year.</p>\r\n<p>Our most recent newsletter is attached.</p>', NULL, 0),
(99, 1135, '<p>&nbsp;</p>\r\n<p>RealTools has invested heavily over the years in its product suite and has moved into the Cloud space ensuring that our offering is ever evolving and developed on Cloud technology for the world to use in their day to day operations.</p>\r\n<p>Although our products are available for purchase as unit items, you can be assured that our Cloud technology in the background supporting your digital marketing products is built on a platform that is constantly improving and ever-changing as we develop new and improved features we make these available to you for a fee to then simply add onto your existing website; this means your website and digital marketing tools will never fail to perform the tasks expected of them and grow with your business!</p>\r\n<p>Cloud Technology is the future and we are driving that future with our product leadership in the Real Estate Sector. The RealTools product development team are constantly researching the Real Estate Agent and Agency and working out better ways to help them sell, list and manage more real estate.</p>\r\n<p><strong>How is your Online and Offline market profile looking?</strong></p>\r\n<p>The Real Estate game is a very competitive industry and ofcourse there are the major advertising portals to sell your listings on but how do you list property in the first place when there are so many agents to choose from? This is where we come into it - consider us your digial marketing partners who understand how competitive listing property is and how emotional this process can be for most sellers! For them, their only due diligence on who to choose is driven by their results and their market profile; which is more than how many letterbox drops have filled the area... it is about your market profile online and offline.</p>', NULL, 1709);

