(7, 6, '2011-01-30 19:45:07', 'George Nissirios', 'george@visiontechdigital.com', '', 'Congratulations on the first episode of The Biggest Loser 2011, look forward to seeing some serious results from Tiffiny and the power of Taekwondo.'),
(8, 6, '2011-02-05 13:59:22', 'Edith', 'edegoly@yahoo.com', '', 'Looking over your site because I have so enjoyed watching Tiffiny on The Biggest Loser Australia. I''m an american in Texas, so alas, can''t attend your program any time soon. What I want to know is what are the non-English language mottoes with which Tiffiny motivates her team, and what do they mean? I would love to learn more. Cheers, Tiffiny, fight the good fight, and may the best team win!'),
(9, 4, '2011-02-08 11:44:55', 'Sandy Weise', 'sandy.weise@savcor.com.au', '', 'Could you upload the all photos from gradings after March 10. I would like to access a photo that was taken of my son who received a black belt in one of the gradings for confidence/attitude- July 10 grading I think.'),
(11, 4, '2011-02-13 13:33:07', 'George Nissirios', 'george@visiontechdigital.com', '', 'Hi Sandy,\n\nI will pass on your request to head office as they are managing the content that is uploaded to the website. All of last years gradings will be uploaded in the coming weeks, so stand by and hopefully you will be able to get your hands on the photo you are after.'),
(12, 6, '2011-02-17 19:27:48', 'Jeanette', 'info@hallstaekwondo.com.au', '', 'Thanks Edith, we are all having fun watching Tiffiny work with the Duncans - despite their temptations!  She often counts in Korean: Hana, Dul, Set, Net  (1, 2, 3, 4) and she gives them commands like Charyeot  (feet together) Kyongrae (bow) or she might have them Kiap (yell) when she says Jumbi (ready) for action! Awesome that you''re watching from Texas, enjoy!'),
(13, 8, '2011-02-20 10:54:42', 'Jeanette', 'jhall3@bigpond.net.au', '', 'What a Great Day!  All Centres really enjoyed the fun and  festivities of Open Day.   Special thanks to our Instructors and Students who warmly welcomed visiting guests to their dojangs! '),
