(16, 8, '2011-05-01 21:26:02', 'mannhary', 'albert.greer@ymail.com', '', 'Hello. I''m ecumenical critic in Sydney. I bent Australia sheerest much and made spot with reference to it.     \nSpellbinding facts about australian floods, australian advice, australian meteorological conditions, australian concision here: http://all-about-australia.info'),
(17, 6, '2011-05-04 13:16:39', 'Jobe Arancon', 'Jobe.arancon1@three.com.au', '', 'Tiffiny has inspired the whole Australia for her techniques in training with the Duncans.Sooo proud of her for being the first timer she was able to let her Ninja Emma won the Biggest Loser Title 2011.My whole family love her so much since seeing her in the show my kids adore her, everywhere we go when they see Tiffiny''s photo my kids will say mummy there''s Tiffiny and you can see a big smile on their little faces.\n Congratulations to all your family for having a talented and loving Tiff in your family.Yayyyy Tiffiny we want you back next year!!!!'),
(18, 4, '2011-05-07 12:32:13', 'Ann', 'aanm13@bigpond.com', '', 'Could pls let me know when photos from the 2011 gradings will be uploaded. With thanks, Ann'),
(19, 6, '2011-06-09 14:52:43', 'Wahbah Tetty Aryati binti Mohd Tuah', 'aryati2611@yahoo.com', '', 'Congratulations to Hall''s Taekwondo & of course to Tiffany Hall. My children miss Hall''s Taekwondo so much and to-date, they still use the Hall;s Taekwondo logo and Australia logo on their uniforms, as they are very proud to be part of Hall''s Taekwondo family when we were staying in Melbourne before. Nur Zawani Mazlan, Muhammad Haziq Mazlan, Nur Liyana Mazlan and Nur Nadiah Mazlan (from Malaysia) send their love & best regards to Nathan, Luke, Mr Hall & all the management & members of Hall''s Taekwondo. They are very active involving in tournaments (sparring) in various levels, from school to international. I would appreciate if u could provide me with information on international tournaments held in Melbourne for next year. Thank you.'),
(20, 6, '2011-08-05 02:21:43', 'nature made fish oil review', 'buggyfodsad@yahoo.com', '', 'Superb site you have here but I was curious if you knew of any discussion boards that cover the same topics talked about in this article? I''d really like to be a part of community where I can get opinions from other knowledgeable individuals that share the same interest. If you have any suggestions, please let me know. Kudos!'),
