(31, 20, '2011-09-06 01:23:26', 'Sharon Stolz', 'Sharon.Stolz@ato.gov.au', '', 'Wow, Martin, Luke and Laura what can we say \\"A trip of a life time!\\"  Can we ever thank you enough??  We had the best time!  \nWe experienced and did things that we would never have imagined we would ever do, in our lifetimes!  Hiking up an active volcano and seeing the sunrise, riding bikes through rice paddy fields, actually experiencing and seeing how Balinese families live and visiting them in their homes were definitely highlights for us!  Our accommodation was beautiful and the food was really good!  New friendships were made and will be kept forever!  \nOn top of all of that, the kindness and consideration shown by Martin, Luke and Laura was outstanding.  You all went above and beyond - doing everything possible to ensure that we had a great trip.  At no time did we ever have any concerns as everything was organised and you all happily provided answers to all our queries.  We cannot thank you enough for all your help, advice and knowledge.  Martin your knowledge of Bali proved to be invaluable.   \nI\\''ll wrap it up with a simple thank you for working so hard to create such a wonderful adventure for us.  We will remember this holiday for years.  We would love to go back!  If Hall\\''s are planning another Bali Adventure in 2012 - we\\''ll be there!!!\nPS - We absolutely love everything about \\''Hall\\''s Taekwondo\\''.  Thank you Martin and Jeanette Hall. Keep doing it right and you will have nothing but continued success in all that you do.  \n'),
(32, 20, '2011-09-07 17:36:03', 'Janet Roberts', 'jroberts@systematicgroup.com.au', '', 'From the moment we landed at Denpasar airport, it was on!\nMartin and Jeanette had the trip planned and orchestrated to the very last detail.\nThe hotel rooms and grounds were safe and clean and offered all that was required and much more.\nThe kids loved the pool, I loved the breakfasts and massages, and Dean loved the Bar!\nNothing was left out, every detail was carefully planned and one activity flowed into the next.\nPlanned runs, beach walks, bike rides, gym sessions, paddle boarding, surfing…and did I mention shopping!\nAs for the activities, the absolute highlight was the volcano climb.\nIt has been 3 weeks now, since we returned, and I am still buzzing.\nBeginning our hike in the dark of night, trekking with the aid of torches, arriving at the rim before sunrise, and being present for the break of dawn amongst the clouds – simply awe inspiring.\nFabulous venues, activities, food, shopping, meals, experiences and company! \nLoved it!\nMy only fear is that such and experience can never be repeated or replicated!\nThanks to Martin for his enthusiasm and generosity – just wonderful….and yes Martin, we did enough!\n'),
(34, 20, '2011-09-07 19:12:58', 'Cindy Coleman ', 'cindyzackai@hotmail.com', '', 'Being fortunate to go on the first Bali Adventure with a fantastic group of people was the best. It was jam packed, let me give you all a run down: Sunday: Relaxed by beach swimming sun baking easy day. Monday: Went to several different surf beaches followed by Uluwatu temple and Kecak dance was interesting watched sunset very beautiful .Seafood dinner at Jimbaran beach got back late. Tuesday: Up at 1.30, 2hr drive to Kitamani Volcano start walking by 4am, ¾ of the way up had breakfast, banana sandwich & an egg watched sunrise continue on to top views are fantastic took 6 hrs all up fantastic highlight of the week followed by 15km bike ride through rice fields which was lots of fun, lunch ,shopping ,walk through the Monkey forest . Wednesday: Morning spent swimming, water aerobics with lots of laughs, after lunch surf lesson at Kuta mastered by the Craig, Dean & Mark. We did Lots of shopping also. Thursday :afternoon white water rafting so much fun then on to Elephant safari park for dinner and night ride on elephants enjoyed by all. Friday: Quicksilver cruise to Nusa Penida Island for snorkeling, water slide, and swimming had an excellent day. Saturday: swimming and shopping. packed to go home. Best holiday ever, can’t wait to go next year. Thanks Martin for organising such a fun packed adventure. '),
(35, 25, '2011-09-21 16:28:31', 'George', 'visiontech@me.com', '', 'Great work team!');
