 product suite and the ability to purchase these items automaticaly online. Ofcourse we are in the background to offer a friendly helping hand during the decision making process of which products work for which agent/agency, however once you have made your mind up on our products and the items you wish to purchase you can simply proceed to our eStore and proceed to checkout securing your product purchase on the spot.</p>\r\n<p class="MsoNormal">Any suggestions to improve our eStore would be much appreciated as we strive to offer a seamless and intitive online experience for the Real Estate professionals seeking to grow their market profile with RealTools Next Generation Digital Marketing Tools for the Real Estate Professional.</p>', 3746, 'Real Estate Marketing', 1);
