(8, '2011 Club Championships', 'info@hallstaekwondo.com.au', 'Hall''s Taekwondo', '<!--   			a { 				color: #0053a0; 			}   			a:hover, 			.footer a:hover { 				color: #e2383f; 			} 		 -->\n<div style="padding: 30px 0pt; text-align: center;">\n<div style="width: 632px; border: 1px solid #999999; margin: 0pt auto;">\n<div class="header"><a style="display: block; border-bottom: 1px solid #999;" href="http://www.hallstaekwondo.com.au/"> <img style="border: none; display: block;" src="http://halls.newsletterpro.com.au/campaigns/images/header.jpg" alt="Hall''s Taekwondo" /> </a></div>\n<div style="width: 632px; height: 62px;"><img src="http://halls.newsletterpro.com.au/campaigns/images/header_bar.jpg" alt="" /></div>\n<h2 class="contents" style="background: #fff; padding: 15px 25px; font-size: 12px;"><!--CONTENT AREA--> \n<table style="width: 578px; height: 803px;" border="0" cellspacing="0" cellpadding="0">\n<tbody>\n<tr style="text-align: left;">\n<td style="width: 385px; vertical-align: top; padding-right: 10px;">\n<p><img src="http://halls.newsletterpro.com.au/campaigns/images/club_champs.jpg" alt="" width="580" height="345" /></p>\n<p>&nbsp;</p>\n<h1 style="text-align: left;"><span style="font-size: x-large;"><span style="font-family: arial,helvetica,sans-serif;"><span style="color: #ff0000;">Hall''s Taekwondo Club Championships</span><br /><span style="color: #000080;">Sunday 7th August, 2011 @ 8.45am - 3.30pm</span></span></span><strong><br /></strong></h1>\n<h1><span style="font-family: arial,helvetica,sans-serif;"><span style="font-size: x-large;">Venue: State Netball Hockey Centre</span></span></h1>\n<p>1 Brens Drive, Parkville, Melbourne.</p>\n<p>This Event is for Everyone, don''t miss out!</p>\n<p>To assist with late Entries we have uploaded a<strong><em><span style="color: #ff0000;"> ''Last Minute Entry Form'' </span></em></strong>to send through to us no later than:<strong> 2pm Saturday 6th August which is available at our website.<br /></strong></p>\n<p>Inviting Joeys, Little Ninjas, Commandos, Leaders, Teens &amp; Adults of all belt levels. Testing  students'' skills and experiencing the joy and exhilaration of  competition in a controlled environment. This is an all day event with  specific category times opposite.</p>\n<p>&nbsp;</p>\n<h1><span style="text-decoration: underline;"><a><strong></strong></a><span style="text-decoration: underline;"><a title="2011 Hall''s Taekwondo Club Championships" href="http://www.hallstaekwondo.com.au/title/news-events/club-championships/3364" target="_blank"><strong><strong>LAST MINUTE ENTRIES CLICK HERE &raquo;</strong></strong></a></span></span></h1>\n<p>&nbsp;</p>\n<p><img src="http://halls.newsletterpro.com.au/campaigns/images/Hall__s_Taekwondo_Club_Championships_2010_16.jpg" alt="" width="580" height="455" /></p>\n<p>&nbsp;</p>\n<p><span style="color: #ff0000;"><strong>COMPETITION ENTRY</strong></span><br />Students enter one or more of the following categories:<br />&raquo; Sparring<br />&raquo; Patterns <br />&raquo; Team Sparring<br />&raquo; Creative Patterns<br />&raquo; Black Belt Demonstration Competition</p>\n<p>&nbsp;</p>\n<p><img src="http://halls.newsletterpro.com.au/campaigns/images/Hall__s_Taekwondo_Club_Championships_2010_53.jpg" alt="" width="580" height="443" /></p>\n<p>&nbsp;</p>\n<p><span style="color: #ff0000;"><strong>PROGRAM OUTLINE</strong></span><br /><span style="color: #000080;"><strong>8:45 - 10:30am</strong></span><br /><span style="color: #ff0000;"><strong>Joeys &amp; Little Ninjas Events</strong></span><br /><em>Last 15 min''s we stay on the courts and enjoy demonstrations by Black Belt Demo Teams!</em><br /><br /><span style="color: #000080;"><strong>10:15am for 10:30start - 1:30pm</strong></span><br /><span style="color: #ff0000;"><strong>Commandos</strong></span><br />Coloured &amp; White Belt Events<br /><br /><span style="color: #000080;"><strong>12:00 - 1:00pm</strong></span><br />Demonstration Competitions<br /><span style="color: #ff0000;"><strong>Commandos/Leaders/Teens</strong></span><br />Black Belts<br /><br /><span style="color: #000080;"><strong>1:00-3:30pm</strong></span><br /><span style="color: #ff0000;"><strong>Leaders/Teens/Adults</strong></span><br />Coloured Belt &amp; White Belt Events and<br /><span style="color: #ff0000;"><strong>Commandos/Leaders/Teens/Adults</strong></span><br />Black Belt Events</p>\n<p>&nbsp;</p>\n<h1><span style="text-decoration: underline;"><span style="color: #000080;"><a title="2011 Hall''s Taekwondo Club Championships" href="http://www.hallstaekwondo.com.au/title/news-events/club-championships/3364" target="_blank"><strong>LAST MINUTE ENTRIES CLICK HERE &raquo;</strong></a></span></span></h1>\n</td>\n</tr>\n</tbody>\n</table>\n<!--CONTENT AREA--></h2>\n<div style="background: #e0373e; padding: 15px 25px 0 25px; vertical-align:bottom;"><!--RED SECTION--> \n<table style="vertical-align:bottom;" border="0" cellspacing="0" cellpadding="0">\n<tbody>\n<tr>\n<td><!--Text-->\n<p style="text-align: left;"><span style="font-size:24px; color:#fff; font-weight:bold;">Thinking about<br />joining us?<br /></span></p>\n<p style="color: #f4bbbd; text-align: left;"><span style="color: #999999;"><span style="color: #ffffff;">You don&rsquo;t have to be an Olympic Gold Medallist to reap the fitness benefits of Hall&rsquo;s Taekwondo.&nbsp; We train in a family friendly environment with an Intro Program you&rsquo;ll love.</span><br /><br /></span></p>\n<p style="text-align: left;"><!--LETS TALK--><a href="#"><img src="http://halls.newsletterpro.com.au/campaigns/images/btn.jpg" border="0" alt="" /></a></p>\n</td>\n<td rowspan="2"><!--Image--> <img style="vertical-align:bottom;" src="http://halls.newsletterpro.com.au/campaigns/images/bottom_img1.jpg" alt="" width="325px" height="288px" /></td>\n</tr>\n</tbody>\n</table>\n</div>\n<div class="footer" style="background: #181818; padding: 0px 25px;">\n<table style="width: 582px; height: 91px;" border="0">\n<tbody>\n<tr>\n<td>\n<p style