(170, 3675, '<p>AgentPRO Individual Agent Websites includes a fully functional 6 x page agent specific website that is completely driven by our WebPublisherCMS (Content Management System) and has the option to have property listings from a specific agent displayed via XML feed from MyDesktop). The domain name would be www.agentprofile.com.au/john.doe and could have any other domain name pointing to it, ie. johndoe.com redirecting to the site which could become the marketed URL for the site on the agents business cards, signboards and even have banner ads linking to the site.<br /><br />Includes the following pages:<br />- Agent Profile<br />- Current Listings<br />- Recently Sold<br />- Testimonials<br />- Appraisal Form<br />- Contact Agent</p>\r\n<p><br /><strong>*MyDesktopXML integration not included.</strong></p>', NULL, 0),
