(114, 1191, '<h2>Can you imagine this impact on your business?<strong> ...You become the Biggest Winner!</strong></h2>\r\n<p>Your staff will thank you for motivating them into Health Ninjas!<strong><br /></strong><strong><br style="height: 390px; width: 640px;" /> Mindset Matters<br /></strong>Let us show you the power of the mind, turning thoughts into actions which is what every competitive business needs.<strong><br /><br />Energise<br /></strong>Simple winning habits taught today, to lose weight, tone up and power into your plan!<strong><br /><br />Success Leaves Clues<br /></strong>Drawing on the teachings of more than 70,000 taekwondo classes, Martin knows you are only as good as your last class! Think like this in business. You either pull people towards you or push them away. It all starts with you.<strong><br />&nbsp;<br />A Healthy You is a Healthy Business<br /></strong>Become a Health Ninja &ndash; we will show you how.<strong><br /><br />Staff remember<br /></strong>10% of what they hear,&nbsp; 20-30% of what they see, 40-50% of what they do and 100% of what they feel!<strong><br /><br />Get Involved<br /></strong>Allow them to feel empowered to make some changes. We show you how with Active Speaking. Fully guaranteed, money back if you&rsquo;re not happy.<strong><br /><br />Committed People<br /></strong>Business cannot find enough healthy motivated and committed people. Imagine your team as Health Ninjas who are on top of their game.<br /><br /></p>\r\n<h2><strong>Why consider Active Speaking?</strong></h2>\r\n<p><br /><strong>Credibility</strong><br />Martin Hall is a family man, multi business owner, mad surfer, gold medal Olympic Coach,&nbsp; Active Speaker who leaves an indelible mark on one&rsquo;s personal and business life.<br /><br />Tiffiny Hall, Martin&rsquo;s daughter is proof that it works. Popular author, Biggest Loser Trainer, Health Ninja, Gladiator, Active Speaker, MC, delivers the same message with her style.<br /><br /><strong>Experienced in</strong><br />- Conference energisers to open and/or close or frequent visits during the course of your conference.<br /><br />- Action with Attitude sessions. <br /><br />- Winning Habits for Healthy Ninjas. What They Say...<br /><br />&ldquo;I hadn&rsquo;t realised how one hour with a unique individual like Martin Hall can impact a group so profoundly.&rdquo;<br /><strong>Dr. Dallas Hartman<br />Manager, Biolab</strong><br /><br />&ldquo;Excellent, simply excellent, providing a great way to close our event with the sounds of around 800 people breaking and then clapping boards. It was a great thrill for all.&rdquo;<br /><strong>John Danks &amp; Son Pty Ltd</strong><br /><br />&ldquo;Definitely a must for personal, professional and business development.&nbsp; After the first punch, I knew I was in for a <br />fun time.&rdquo;<br /><strong>Chris Rulewski<br />Business Management Support, Telstra</strong><br /><br />&ldquo;Tiffiny Hall was the highlight of The National Leaders&rsquo; Conference! She ran one of the most incredible and motivating sessions I have been privileged enough to take part in. She engaged the students in physical processes, whilst at the same time leaving them hanging on every word. Tiffiny&rsquo;s ability to connect with every student in the room was simply amazing! Then again, after being apart of her session, that&rsquo;s just what Tiffiny Hall is, amazing! <br /><br />On behalf of yLead and The National Leaders&rsquo; Conference I would highly recommend Tiffiny to any school, business or group that is wishing to bring together a team of people and wants to challenge them to break through their barriers.&rdquo;<br /><strong>James Tierney<br />The National Leaders&rsquo; Conference Coordinator</strong><strong>&nbsp;</strong></p>\r\n<p><strong>Tailored Sessions<br /></strong>Don&rsquo;t know what you want? <br />Let us propose a session to suit your needs.<strong>&nbsp;</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Videos<br /></strong></p>\r\n<table border="0" width="250" height="364">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<object width="250" height="142">\r\n<param name="movie" value="http://www.youtube.com/v/DTOoJjOElXc?version=3&amp;hl=en_US" />\r\n<param name="allowFullScreen" value="true" />\r\n<param name="allowscriptaccess" value="always" /><embed type="application/x-shockwave-flash" width="250" height="142" src="http://www.youtube.com/v/DTOoJjOElXc?version=3&amp;hl=en_US" allowscriptaccess="always" allowfullscreen="true"></embed>\r\n</object>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<object width="250" height="142">\r\n<param name="movie" value="http://www.youtube.com/v/zmojWeOFVrg?version=3&amp;hl=en_US" />\r\n<param name="allowFullScreen" value="true" />\r\n<param name="allowscriptaccess" value="always" /><embed type="application/x-shockwave-flash" width="250" height="142" src="http://www.youtube.com/v/zmojWeOFVrg?version=3&amp;hl=en_US" allowscriptaccess="always" allowfullscreen="true"></embed>\r\n</object>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', NULL, 361),
