(166, 3535, '<p>In pursuit of excellence, all Hall''s Taekwondo Students come together at one central location for testings, 4 times a year.</p>\r\n<p><strong><span style="font-size: small;">SEPTEMBER 2011 GRADING</span></strong></p>\r\n<p><strong>This coming COLOURED BELT &amp; BLACK BELT grading will be  run in the Show Court at SNHC, State Netball Hockey Centre, Parkville on  SATURDAY 24th September &amp; SUNDAY 25th September,</strong> according to the attached Grading Schedule.</p>\r\n<p><strong><br /></strong>This is a world class facility with ample car  parking. Address: 1 Brens Drive, near Melbourne Zoo, off Elliott Avenue,  Parkville.<strong><br /></strong></p>\r\n<p>Grading Events are carefully designed so that Instructors, students and parents can enjoy peoples'' success.&nbsp;</p>\r\n<p>Students are graded at various times in groups, according to age and belt level. Please download the <strong>GRADING SCHEDULE</strong> on this page.</p>\r\n<p>Hall''s Taekwondo''s highly qualified Instructors and staff assist at  the gradings under the guidance and supervision of Martin Hall, 7th Dan  Head Instructor who actively particpates at all the grading events.</p>\r\n<p>Everyone works from the same <a title="Grading Syllabus" href="../article/education/tkd-syllabus/1118">360&deg; Syllabus</a> reinforced by Instructors at individual Centres. Quality control is  ensured at regular staff training sessions.&nbsp; Gradings with Hall''s  Taekwondo are memorable events to be enjoyed.</p>\r\n<p>Those who participated in the last Grading are able to download their photos from our <a href="../galleries/gallery/gradings/1910">Gallery.</a></p>\r\n<p>We invite you to come along to our upcoming Grading Event and enjoy students'' success!</p>\r\n<p>Enquire today if you''d like to find out more about getting started at Hall''s Taekwondo.</p>', NULL, 0),
(154, 1719, '<p><span style="font-size: large;"><strong>All Welcome to OPEN DAY @ all 4 Hall''s Centres<br /></strong></span></p>\r\n<p><span style="color: #ff0000; font-size: medium;"><strong>Saturday 17th September 9am-2pm</strong></span><br /><br />See students, all ages, training in regular classes plus Entertaining Demonstrations by Junior Blackbelts. There''s something for everyone! Download a Flyer below.</p>\r\n<p><strong><span style="color: #ff0000;"><em><span style="font-size: small;">Special Highlight:</span></em></span></strong></p>\r\n<p><strong><span style="font-size: small;">Meet Tiffiny Hall</span></strong>, visiting all Hall''s Taekwondo Centres at the following times:</p>\r\n<p><a title="Hall''s Taekwondo Heidelberg" href="../location/heidelberg/1005">Hall''s TKD <strong>Heidelberg</strong></a>: 9am&mdash;9:30am<br /><a title="Hall''s Taekwondo Brunswick" href="../location/brunswick/1000">Hall''s TKD <strong>Brunswick</strong></a>: 10am&mdash;10:30am<br /><a title="Hall''s Taekwondo Tullamarine" href="../location/tullamarine/351">Hall''s TKD <strong>Tullamarine</strong></a>: 10:45am&mdash;11:15am<br /><a title="Hall''s Taekwondo Sunshine" href="../location/sunshine/1003">Hall''s TKD <strong>Sunshine</strong></a>: 11:30am&mdash;12noon</p>\r\n<p><span style="font-size: small; color: #ff0000;"><strong>FREE</strong></span><br />&bull; Giveaways to Guests<br />&bull; Getting Started Intros<br />&bull; Demonstrations<br />&bull; &amp; much more!<br /><strong></strong></p>\r\n<p>CELEBRATE OPEN DAY AT YOUR NEAREST HALL''S TAEKWONDO CENTRE:</p>\r\n<p><strong>TULLAMARINE</strong></p>\r\n<p style="text-align: left;"><img src="wpdata/images/461-l.jpg" alt="" width="180" height="125" /></p>\r\n<p style="text-align: left;"><strong>BRUNSWICK</strong></p>\r\n<p style="text-align: left;"><img src="wpdata/images/450-l.jpg" alt="" width="180" height="125" /></p>\r\n<p style="text-align: left;"><strong>HEIDELBERG</strong></p>\r\n<p style="text-align: left;"><img src="wpdata/images/459-l.jpg" alt="" width="180" height="125" /></p>\r\n<p style="text-align: left;"><strong>SUNSHINE</strong></p>\r\n<p style="text-align: left;"><img src="wpdata/images/458-l.jpg" alt="" /></p>\r\n<p style="text-align: left;">Can''t make it to Open Day but want to know more about trying out Hall''s Taekwondo?&nbsp; <a title="Getting Started" href="../title/taekwondo-systems/intros/854"><em>Click here</em></a> to find out how!</p>', NULL, 0),
(157, 2012, '<p>As proud sponsors of Moonee Valley Festival we invite you to join us for a ''Class in the Park''<br /><span style="color: #ff6600;"><span style="font-size: small;"><br /></span></span><strong><span style="color: #000000;"><span style="font-size: small;">Sunday 27 February<br />10am - 5:30pm</span></span><br /><span style="font-size: small;"><span style="color: #800080;">Moonee Valley Festival,</span></span> Queens Park,<br />Mt. Alexander Road, Moonee Ponds, Mel Ref: 28/J6</strong><br /><br />We are hosting &nbsp;2 main features.<br />''<strong> Hall&rsquo;s Taekwondo Demo Area</strong>'' <br />(where we will perform all day, near Kellaway Avenue in Queens Park)</p>\r\n<p>AND</p>\r\n<p>''<strong> Hall&rsquo;s Taekwondo Kids Stage</strong>'' <br />(where we will host other community groups performing near Mt. Alexander Rd &amp; The Strand)<br /><br />Inviting all Hall&rsquo;s Taekwondo Students &amp; their Families to join us for a <br /><span style="color: #800080;"><span style="font-size: small;"><strong>Class in the Park<br /></strong></span></span></p>\r\n<p>&ldquo;Hall&rsquo;s Taekwondo Demo Area&rdquo; <br />This fun Day out will appeal to all students of all ages, and their families. You&rsquo;ll have the chance to do a class in the park, in your Taekwondo gear or casuals, on our matted &lsquo;outdoor dojang&rsquo;. You&rsquo;ll see some really cool demos by our Xtreme &amp; Shadow Teams and you can join in &lsquo;KaPow&rsquo; competitions. Friends can &lsquo;Give It a Go&rsquo; in Free Taekwondo Clinics sponsored by us as well. Festival Fever for everyone with Gift Giveaways all Day!<br /><br /><span style="color: #800080;"><strong>Class in the Park</strong></span> Programming for Hall&rsquo;s Taekwondo Demo Area</p>\r\n<p><span style="color: #ff6600;"><span style="color: #000000;">10am</span> </span>Welcome!<br />&laquo; 10 mins DEMONSTRATIONS &amp; FREE CLINICS<br /><br />10:10am-10:30am&nbsp; <span style="color: #800080;"><strong>JOEYS</strong></span> class <br />&laquo; 30 mins DEMONSTRATIONS &amp; FREE CLINICS<br /><br />11am-11:30am <span style="color: #800080;"><strong>LITTLE NINJAS</strong></span> class <br />&laquo; 30 mins DEMONSTRATIONS &amp; FREE CLINICS<br /><br />12:00-12:30pm&nbsp; <span style="color: #800080;"><strong>COMMANDOS/LEADERS</strong></span> class <br />&laquo; 30 mins DEMONSTRATIONS &amp; FREE CLINICS<br /><br />2pm-2:30pm&nbsp; <span style="color: #800080;"><strong>LITTLE NINJAS</strong></span> class <br />&laquo; 30 mins DEMONSTRATIONS &amp; FREE CLINICS<br /><br />3pm&ndash;3:30pm &nbsp;<strong><span style="color: #ff6600;"> <span style="color: #800080;">C</span></span><span style="color: #ff6600;"><span style="color: #800080;">OMMANDO</span><span style="color: #800080;">S/LEADERS</span></span></strong> class <br />&laquo; 30+ &nbsp;mins DEMONSTRATIONS &amp; FREE CLINICS</p>', NULL, 0);
INSERT INTO `wp_article` (`recId`, `link`, `content`, `longtitle`, `logo`) VALUES
(163, 2637, '<h2><strong>Private Advanced <br />Pre-Screening Kung Fu Panda 2</strong></h2>\r\n<h4>Sunday 19th June, 2011 <br />HOYTS Highpoint 2pm-4pm</h4>\r\n<p><br />Hall&rsquo;s Taekwondo has organised 2 x Cinemas and 500 tickets. Tickets are available only from Hall&rsquo;s Taekwondo Centres.</p>\r\n<p><strong>All Tickets $13 &ndash; Adults at Kids prices!<br /></strong></p>\r\n<p>Kids under 2 years must have a free &lsquo;lap ticket&rsquo; also available from Hall&rsquo;s Taekwondo Centres. <br /><br />Added Feature same day... <br />also at Highpoint at 1pm</p>\r\n<p><strong><span style="color: #ff0000;">Demo Team Xtreme</span></strong><strong> @</strong><strong> 1pm &ndash; 1:30pm </strong><strong><br />Grand Finalists from Australia&rsquo;s Got Talent 2 seasons ago! plus fun Taekwondo Clinics</strong><br /><br />Centre Stage, lower level at Highpoint Rosamond Rd, Maribyrnong, 3032 VIC<br /><br />This  will be one of Melbourne&rsquo;s first screenings of Kung Fu Panda 2. We are  thrilled to be able to organise this for you.</p>\r\n<p>&raquo; No Door sales.</p>\r\n<p>&raquo; Tickets  must be purchased from Hall&rsquo;s Taekwondo Centres and taken to the  Cinema.</p>\r\n<p>&raquo; Add more FUN by getting into character by wearing your  Taekwondo Dobok!</p>\r\n<p>&raquo; Join us for the Demonstration and lucky people who  have secured tickets can move down to the cinema with Demo Team Xtreme  for our special screenings.</p>\r\n<p><br /><strong>Hope to see you there!</strong></p>', NULL, 0);
