(3, 1067, '<p><strong>Get Ya Ninja on</strong>! and Join the 8 Week Challenge WINTER SPECIAL &gt;&gt; call 1300gohalls to find out more!</p>\r\n<p>More info also at your Centres.&nbsp; Check out Club Kaizen programs and follow the philosophy of continual improvement to a better body and a stronger mindset.</p>\r\n<p>Tiffiny''s contestant <strong>WINS</strong> the Biggest Loser!</p>\r\n<p>&nbsp;</p>\r\n<p>\r\n<object id="player-element" classid="clsid:D27CDB6E-AE6D-11cf-96B8-444553540000" width="300" height="328" codebase="http://fpdownload.macromedia.com/get/flashplayer/current/swflash.cab">\r\n<param name="movie" value="http://apps.v2.movideo.com/player/flash/movideo_player.swf" />\r\n<param name="quality" value="high" />\r\n<param name="bgcolor" value="#000000" />\r\n<param name="allowScriptAccess" value="always" />\r\n<param name="allowFullScreen" value="true" />\r\n<param name="wmode" value="window" />\r\n<param name="flashVars" value="apiKey=movideoCircle&amp;alias=the-circle-external-embed&amp;playerId=movideoCircle_the-circle-external-embed_1304848677607&amp;mediaId=105259" /><embed type="application/x-shockwave-flash" width="300" height="328" src="http://apps.v2.movideo.com/player/flash/movideo_player.swf" quality="high" bgcolor="#000000" name="player-element" play="true" loop="false" allowscriptaccess="always" allowfullscreen="true" wmode="window" pluginspage="http://www.adobe.com/go/getflashplayer" flashvars="apiKey=movideoCircle&amp;alias=the-circle-external-embed&amp;playerId=movideoCircle_the-circle-external-embed_1304848677607&amp;mediaId=105259" align="middle"></embed>\r\n</object>\r\n</p>\r\n<p><br /><strong>Congratulations Emma Duncan for Winning the Biggest Loser, 2011 and well done Tiffiny for taking her there!<br /></strong></p>\r\n<p>Club Kaizen <strong>Personal Training </strong>follows Tiffiny''s Biggest Loser recommendations.&nbsp; Call 9330.0032 and book your sessions with one of our new qualified Instructors.</p>\r\n<p><a href="../tiffiny-hall">Tiffiny Hall</a> joined us at our Grading Sunday 10th April &raquo; Your chance to purchase a signed copy of <a title="Weightloss Warrior" href="../shop/product/122"><span style="color: #008080;"><strong><span style="color: #ff6600;">Weightloss</span> Warrior</strong>.</span></a></p>\r\n<p><strong>MCS Classes</strong> continue. Are your work books up-to-date?<br /><strong><br /></strong><br /><br /></p>\r\n<p><strong><br /></strong></p>', 'Hall''s Taekwondo Calendar', '2011-02-01', '2011-04-08', '2011-01-01', '2011-10-10');
