INSERT INTO `wp_product` (`recId`, `link`, `sizes`, `colours`, `content`, `longtitle`, `price`, `product_code`, `product_postage1`, `product_postage2`, `product_postage3`) VALUES
(89, 3728, '', '', '<p>- 6 local keywords targeted<br />- On-site code optimisation<br />- Content Massaging<br />- Link-building Campaign<br />- Keyword Research<br />- Competition Analysis<br />- Monthly Reporting<br />- 6 Month Contract</p>\r\n<p>&nbsp;</p>\r\n<p><strong>*Paid Monthly.<br /></strong></p>', NULL, 490.00, 'RT007', 0.00, 0.00, 0.00),
(90, 3729, '', '', '<p>SEO: ELITE<br />On-Site - Content Manipulation<br />Content should be relevant to the targeted keywords, and this must be done in a manner that is easily visible to an automated algorithm, such as a search engine robot.</p>\r\n<p>On-site &ndash; Removing Limitations<br />Many sites have limitations which work against them; this could be links which go nowhere, invalid code, or any number of factors. The good thing is, so do many of their competitors. By cleaning up code and setting up the foundation of the website we can ensure SEO success.</p>\r\n<p>Off-site &ndash; Link-building (not available in the LITE version)<br />Search Engines favour the most relevant content, and this means that a website which has a current &lsquo;buzz&rsquo; of other sites linking to it is most likely what the searcher is looking for, and thus it will rank well. As such, link-building must look as though it is occurring naturally through popularity, and not through an automated process. As such, we produce this social buzz around your site through a random and rather chaotic linking pattern which leaves no footprint, and looks very natural to a search engine, which leads to a very solid increase in rankings.</p>\r\n<p>Our Process<br />1. Keyword research &ndash; we will find the keywords related to your business which will be attainable to rank for, and will provide a good flow of traffic once the website is ranked well for.<br />2. Competition Analysis &ndash; we will analyse the top competitors in each keyword, and ensure it will be possible to achieve the results we are looking for.<br />3. On-Site SEO &ndash; We will carry out on-site SEO, ensuring the code is correct for SEO, and all correct SEO elements are in place.<br />4. Content Massaging &ndash; We will modify the content on the website to ensure it contains the correct keyword density to rank well.<br />5. Link-building Strategy &ndash; We will create social &lsquo;buzz&rsquo; around your site, causing Google to see them as an authoritative channel for information.<br />6. Review and Repeat &ndash; Each month we will review the progress and current rankings, and modify the on-site to adapt to this. We will continue the link-building campaign, and modify our strategy where necessary to ensure deliverables are met.</p>\r\n<p>SEO Items<br /><br />Targeted&nbsp; Keywords - x15<br />Competition Analysis - Yes<br />Monthly Reporting - Yes<br />On-Site Optimization - Yes<br />Max-Exact-Match Traffic for Keywords - 6000<br />Conversion Tracking - Yes<br />Content Writing - x2 Articles<br /><br /></p>', NULL, 800.00, '', 0.00, 0.00, 0.00),
(91, 3730, '', '', '<p>PROPERTY DATA INTEGRATION via XML Feed from MyDesktop</p>\r\n<p><br /> - Seamless XML Auto-Property Data Integration (Sales + Rentals), Upload to MyDesktop and push listings to your website automatically, Enabling Auto Property Alerts Feature (powered by MyDesktop)</p>\r\n<p>*Must have an active MyDesktop Account<br /> *Must sign an XML release authority form<br /> *Allow 2 hours between updating MyDesktop and your website for changes to be visible.<br /> *XML Support is currently only available for MyDesktop XML data feed (REA Format)</p>', NULL, 1000.00, '', 0.00, 0.00, 0.00),
(92, 3731, '', '', '<p>AgentPRO Individual Agent Websites includes a fully functional 6 x  page agent specific website that is completely driven by our  WebPublisherCMS (Content Management System) and has the option to have  property listings from a specific agent displayed via XML feed from  MyDesktop). The domain name would be www.agentprofile.com.au/john.doe  and could have any other domain name pointing to it, ie. johndoe.com  redirecting to the site which could become the marketed URL for the site  on the agents business cards, signboards and even have banner ads  linking to the site.<br /><br />Includes the following pages:<br />- Agent Profile<br />- Current Listings<br />- Recently Sold<br />- Testimonials<br />- Appraisal Form<br />- Contact Agent</p>\r\n<p><br /><strong>*MyDesktopXML integration not included.</strong></p>', NULL, 1490.00, '', 0.00, 0.00, 0.00),
(94, 3733, '', '', '<p>Brings you the power to have your listings with you on the go, ensuring  no opportunity is lost when you are on the road. The Mobile Website is  your office website in a beautiful iPhone* and Android* format drawing  your listings from your MyDesktop XML data feed directly to the smart  phone handset (touch experience; optimised for iOS and AndroidOs only).  The changes you make on your desktop website will be appear on your  Mobile Website, ensuring you have every angle covered when pushing your  office and its listings to the market.</p>', NULL, 1000.00, 'RT003', 0.00, 0.00, 0.00),
(96, 3735, '', '', '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas  molestie vulputate justo, sit amet vulputate enim elementum nec. Aenean  ut erat mauris. Donec quis nulla sit amet lorem porttitor imperdiet  imperdiet a elit. Duis interdum elit sem. Praesent pharetra justo luctus  lectus faucibus auctor. Sed est justo, vehicula bibendum egestas ac,  tincidunt at lectus.</p>', NULL, 200.00, '', 0.00, 0.00, 0.00),
