(98, 3737, '', '', '<p>Animated Flash Banner ad for use on property portal of your choice. This service includes storyboard, design, production and submission to the portal in the .SWF format and to portal specifications; 3 x rounds of amendments included in this service. We require 3-5 days to deliver your banner ad form the date of purchase.</p>', NULL, 200.00, '', 0.00, 0.00, 0.00),
(99, 3738, '', '', '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas  molestie vulputate justo, sit amet vulputate enim elementum nec. Aenean  ut erat mauris. Donec quis nulla sit amet lorem porttitor imperdiet  imperdiet a elit. Duis interdum elit sem. Praesent pharetra justo luctus  lectus faucibus auctor. Sed est justo, vehicula bibendum egestas ac,  tincidunt at lectus. Donec sed ante sit amet odio adipiscing sodales  vitae sed elit. Sed faucibus malesuada mauris a convallis. Aliquam ut  eros turpis, quis fermentum metus.</p>', NULL, 2000.00, '', 0.00, 0.00, 0.00),
(100, 3740, '', '', '<p>Design and develop a rich html email friendly  template for viewing via email clients with a viewing dimension of no  more than 650px wide and an unlimited height; price does not include email sending/blast and is optimised for Mac Mail, Outlook, Hotmail, Gmail and Thunderbird. Email clients not listed are not supported.</p>\r\n<p><strong>*Insert into MyDesktop''s ePublisher for send out to your client data base.</strong></p>', NULL, 525.00, 'RT008', 0.00, 0.00, 0.00),
(107, 3762, '', '', '<p>The One Page feature website is perfect for that special property for sale or lease that deserves its own individual online presence. Perfect for an online banner click through levergaing the traffic from the major real estate portals and steering them to a page that is dedicated to that property.</p>\r\n<p>This product includes:</p>\r\n<p>- 1 x web page template with 4 sub-pages<br />- Enquiry form (sends to nominated email address)<br />- Google Maps<br />- Image Gallery<br />- Floorplan view<br />- Testimonials</p>\r\n<p><span style="color: #ff6600;"><strong>Live Examples:</strong></span><br /><a title="Sample 1" href="http://www.emeraldvillabali.com" target="_blank"><span style="color: #ff6600;">http://www.emeraldvillabali.com</span></a><br /><a title="Sample 2" href="http://www.thecovevillage.com.au" target="_blank"><span style="color: #ff6600;">http://www.thecovevillage.com.au</span></a></p>\r\n<p>*Hosting for this product is $10AUD+GST per month. Domain Name registration not included.</p>', NULL, 990.00, '', 0.00, 0.00, 0.00),
(108, 3764, '', '', '<p>Registration of a .com.au Domain Name for your new website for a registration period of 2 years.<br /><br />Includes:</p>\r\n<p>- Registration of the .com.au Domain<br />- Delegation of the Domain to your new website<br />- General Domain Name Management</p>', NULL, 140.00, '', 0.00, 0.00, 0.00),
(111, 3769, '', '', '<p>Enterprise-class web analytics made smarter, friendlier and free. Google Analytics is the enterprise-class web analytics solution that gives you rich insights into your website traffic and marketing effectiveness. Powerful, flexible and easy-to-use features now let you see and analyze your traffic data in an entirely new way. With Google Analytics, you''re more prepared to write better-targeted ads, strengthen your marketing initiatives and create higher converting websites.</p>\r\n<p>Although Google Analytics reporting service is free and proudly provided by Google, there is a fee for setup, configuration of both the embed code and account setup.</p>\r\n<p>*Limited to 1 x Domain Name</p>', NULL, 175.00, '', 0.00, 0.00, 0.00),
(101, 3752, '', '', '<div class="product-detail-description">\r\n<p>Liftover of Animated Flash Banner ad from existing .FLA for use on property portal of your  choice. This service includes design updates, production and  submission to the portal in the .SWF format and to portal  specifications; 3 x rounds of amendments included in this service. We  require 2-3 days to deliver your banner ad form the date of purchase.</p>\r\n</div>', NULL, 100.00, 'RT005', 0.00, 0.00, 0.00),
(105, 3759, '', '', '<p>UNLIMITED ''LITE'' WEBSITE Package offers your real estate agency the opportunity to own a world class website to promote your sales listings, rentals and much more with cutting edge web technology at a fraction of the price you would normally expect to pay for technology of this calibre.</p>\r\n<p>Features Include:</p>\r\n<p>- 10 x CMS Driven Pages, Unlimited Property Listings<br />- WebPublisherCMS Content Management System<br />- Personalised Interface Design on our Fixed Grid<br />- Dynamic Drop-down Navigation<br />- Advanced Property Search<br />- Quick Property Search<br />- Staff Profiles Gallery<br />- 1 x Market Appraisal Request Form<br />- 1 x General Contact Request Form<br />- Printable/Downloadable Brochures (PDF)<br />- Editable Home Page Image Slideshow<br />- Property Detail Page Overlay<br />- 1 x hour complimentary Training + Support.</p>\r\n<p><br /><span style="color: #ff6600;"><strong>*Add $1000+GST for MyDesktop XML Property Feed Integration; <a title="XML" href="../shop/product/3730" target="_self">click here to add this item to your order</a></strong></span></p>\r\n<p>*Hosting + Support for this product is at $49.90AUD+GST per month and includes 1GB of data storage. Domain Name Registration is not included but is avaiable for registration at our eStore.</p>\r\n<p><strong><br /></strong></p>', '', 1990.00, '', 0.00, 0.00, 0.00),
